    canvas:focus {
      outline: none;
    }
  </style>
  <link rel='stylesheet' href='css/showcase.css'>
  <link rel='stylesheet' href='css/unsupported_browser.css'>
</head>

</div>

<main>

  </div>

          <circle r='44' cx='48' cy='48'></circle>
          <circle id='bar' r='44' cx='48' cy='48'></circle>

  };
